import React from 'react';
import useForm from "react-hook-form";
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Icon from '@material-ui/core/Icon';


const useStyles = makeStyles(theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
    margin: 'auto'
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
  },
  button: {
    margin: theme.spacing(1),
  },
  rightIcon: {
    marginLeft: theme.spacing(1),
  }
}));

function formData(props) {
  const [name, setName] = React.useState("");
  const [email, setEmail] = React.useState("");
  const [message, setMessage] = React.useState("");
}

function handleSubmit(e) {
  e.preventDefault();
  console.log("Data submitted!", {name, email, message})
}

export default function TextFieldMargins() {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <TextField   
        variant="outlined"
        label="Name"
        id="Name_field"
        placeholder="Please enter your name"
        className={classes.textField}
        helperText="Help us get to know you!"
        margin="normal"
      />
      <TextField
        variant="outlined"
        label="Email"
        id="Email_field"
        placeholder="Valid Email"
        className={classes.textField}
        helperText="How can we reach you?"
        margin="normal"
      />
      <TextField
        variant="outlined"
        label="Message"
        id="Message_field"
        placeholder="Message"
        className={classes.textField}
        helperText="What can we help you with?"
        margin="normal"
      />
      <Button type="submit" onClick={handleSubmit(onSubmit)} variant="contained" color="primary" className={classes.button}>
        Send
        <Icon className={classes.rightIcon}>send</Icon>
      </Button>
    </div>
    
  );
}
